import TSNSmall from './the-social-network/small.jpg';
import TSNLarge from './the-social-network/large.jpg';

const drama = [
    { Title: 'Fight Club', Small: FCSmall, Large: FCLarge },
    { Title: `King's Speech`, Small: KCSmall, Large: KCLarge },
    { Title: 'The Prestige', Small: TPSmall, Large: TPLarge },
    { Title: 'The Revenant', Small: TRSmall, Large: TRLarge },
    { Title: 'The Social Network', Small: TSNSmall, Large: TSNLarge },
]

export default drama;
